content:
#trp-floater-ls {
    position: fixed;
    z-index: 9999999;
    bottom: 0;
    left: 80%;
    border-radius: 5px 5px 0 0;
    display: block;
    overflow: hidden;
}

#trp-floater-ls.trp-color-dark{
    background: rgb(27,27,27);
    background: linear-gradient(0deg, rgba(27,27,27,1) 0%, rgba(84,84,84,1) 100%);
}

#trp-floater-ls.trp-color-light{
    background: rgb(214,214,214);
    background: linear-gradient(0deg, rgba(214,214,214,1) 0%, rgba(250,250,250,1) 100%);
}

#trp-floater-ls.trp-bottom-left{
    left: 10%;
}

#trp-floater-ls.trp-top-right{
    bottom:auto;
    top: 0;
    border-radius: 0 0 5px 5px;
}

#trp-floater-ls.trp-top-left{
    bottom:auto;
    top: 0;
    left: 10%;
    border-radius: 0 0 5px 5px;
}

body.admin-bar #trp-floater-ls.trp-top-right,
body.admin-bar #trp-floater-ls.trp-top-left{
    top: 32px;
}

@media screen and (max-width: 782px) {
    body.admin-bar #trp-floater-ls.trp-top-right,
    body.admin-bar #trp-floater-ls.trp-top-left {
        top: 46px;
    }
}

@media screen and (max-width: 1000px) {
    #trp-floater-ls {
        left: 50%;
    }
}

@media screen and (max-width: 500px) {
    #trp-floater-ls {
        left: 10%;
    }
}

#trp-floater-ls.trp-floater-ls-codes  #trp-floater-ls-current-language a,
#trp-floater-ls.trp-floater-ls-codes #trp-floater-ls-language-list {
    text-align: center;
}

#trp-floater-ls.trp-floater-ls-flags #trp-floater-ls-current-language a img,
#trp-floater-ls.trp-floater-ls-flags #trp-floater-ls-language-list a img {
    text-align: center;
    display: block;
    margin: 0 auto;
}

#trp-floater-ls-language-list {
    display: none;
}

.trp-poweredby #trp-floater-ls-language-list .trp-language-wrap{
    padding: 25px;
    width: auto;
}

#trp-floater-ls.trp-top-right.trp-poweredby.trp-color-dark #trp-floater-ls-language-list #trp-floater-poweredby,
#trp-floater-ls.trp-top-left.trp-poweredby.trp-color-dark #trp-floater-ls-language-list #trp-floater-poweredby{
    border-top: none;
    border-bottom: 1px solid #747474;
}
#trp-floater-ls.trp-top-right.trp-poweredby.trp-color-light #trp-floater-ls-language-list #trp-floater-poweredby,
#trp-floater-ls.trp-top-left.trp-poweredby.trp-color-light #trp-floater-ls-language-list #trp-floater-poweredby{
    border-top: none;
    border-bottom: 1px solid #aaaaaa;
}

.trp-color-dark.trp-poweredby #trp-floater-ls-language-list #trp-floater-poweredby{
    border-top: 1px solid #747474;
    color: #b3b3b3;
}
.trp-color-light.trp-poweredby #trp-floater-ls-language-list #trp-floater-poweredby{
    border-top: 1px solid #aaaaaa;
    color: #808080;
}

.trp-poweredby #trp-floater-ls-language-list #trp-floater-poweredby{
    padding: 5px;
    text-align: center;
    font-size: 10px;
}

.trp-poweredby #trp-floater-ls-language-list #trp-floater-poweredby a{
    display: inline;
    padding: 0px 3px;
    border-radius: 30px;
    background: #b3b3b3;
    color: #111;
    line-height: 11px;
}
.trp-poweredby #trp-floater-ls-language-list #trp-floater-poweredby a:hover{
    background: #f64f4f;
    color: #f1f1f1;
    opacity: 1;
}


#trp-floater-ls:focus #trp-floater-ls-current-language,
#trp-floater-ls:hover #trp-floater-ls-current-language {
    display: none;
}

#trp-floater-ls:focus #trp-floater-ls-language-list,
#trp-floater-ls:hover #trp-floater-ls-language-list {
    display: block;
}

#trp-floater-ls {
    box-shadow: 0 0 5px #212121;
}

#trp-floater-ls-current-language a,
#trp-floater-ls-language-list a {
    display: block;
    padding: 10px 15px 10px 15px;
    font-size: 90%;
}

#trp-floater-ls-current-language,
#trp-floater-ls-language-list {
    text-align: left;
}

#trp-floater-ls-current-language.trp-with-flags,
#trp-floater-ls-language-list.trp-with-flags {
    text-align: left;
}

#trp-floater-ls-current-language {
    display: block;
    width: 100%;
    height: 100%;
}

.trp-color-dark #trp-floater-ls-current-language a,
.trp-color-dark #trp-floater-ls-language-list a {
    color: #BDBDBD;
}
.trp-color-light #trp-floater-ls-current-language a,
.trp-color-light #trp-floater-ls-language-list a {
    color: #404040;
}

.trp-color-dark #trp-floater-ls-current-language a,
.trp-color-dark #trp-floater-ls-language-list a {
    display: block;
    width: auto;
    overflow: hidden;
    text-overflow: ellipsis;
    white-space: nowrap;
}

#trp-floater-ls-language-list a:hover {
    color: #FAFAFA;
    background-color: #656565;
}

#trp-floater-ls .trp-floater-ls-disabled-language {
    pointer-events: none;
    cursor: default;
}

#trp-floater-ls .trp-with-flags .trp-flag-image {
    margin-right: 5px;
    margin-top: -1px;
    vertical-align: middle;
    height: auto;
    max-width: 100%;
    display: inline;
    padding: 0;
}

.trp-flag-image:dir(rtl) {
    margin-left: 5px;
}

#trp-floater-ls a {
    text-decoration: none;
}

#trp-floater-ls-language-list{
    max-height: 300px;
    overflow-y: auto;
}

/*
 *  Menu Language Switcher
 */

.menu-item-object-language_switcher .trp-flag-image {
    display: inline-block;
    margin: -1px 5px;
    vertical-align: baseline;
    padding: 0;
    border: 0;
    border-radius:0;
}

/*
 *  Shortcode Language Switcher
 */
.trp-language-switcher{
    height: 42px;
    position: relative;
    box-sizing: border-box;
    width: 200px;
    text-overflow: ellipsis;
    white-space: nowrap;
}


.trp-language-switcher > div {
    box-sizing: border-box;
    padding:4px 20px 3px 13px;
    border: 1.5px solid #949494;
    border-radius: 2px;
    background-image: url(../../assets/images/arrow-down-3101.svg);
    background-repeat: no-repeat;

    background-position:
            calc(100% - 20px) calc(1em + 2px),
            calc(100% - 3px) calc(1em + 0px);

    background-size:
            8px 8px,
            8px 8px;

    background-repeat: no-repeat;

    background-color: #fff;
}

.trp-language-switcher > div:hover {
    background-image: none;
}


.trp-language-switcher > div > a {
    display: block;
    padding: 7px 12px;
    border-radius: 3px;
    text-decoration: none;
    color: #1E1E1E;
    font-style: normal;
    font-weight: 400;
    font-size: 16px;
}

.trp-language-switcher > div > a:hover {
    background: #F0F0F0;
    border-radius: 2px;
}
.trp-language-switcher > div > a.trp-ls-shortcode-disabled-language {
    cursor: default;
}
.trp-language-switcher > div > a.trp-ls-shortcode-disabled-language:hover {
    background: none;
}

.trp-language-switcher > div > a > img{
    display: inline;
    margin: 0 3px;
    width: 18px;
    height: 12px;
    border-radius: 0;
}

.trp-language-switcher .trp-ls-shortcode-current-language{
    display: inline-block;
}
.trp-language-switcher:focus .trp-ls-shortcode-current-language,
.trp-language-switcher:hover .trp-ls-shortcode-current-language{
    visibility: hidden;
}

.trp-language-switcher .trp-ls-shortcode-language{
    display: inline-block;
    height: 1px;
    overflow: hidden;
    visibility: hidden;
    z-index: 1;

    max-height: 250px;
    overflow-y: auto;
    left: 0;
    top: 0;
    min-height: auto;
}

.trp-language-switcher:focus .trp-ls-shortcode-language,
.trp-language-switcher:hover .trp-ls-shortcode-language{
    visibility: visible;
    max-height: 250px;
    padding: 4px 13px;
    height: auto;
    overflow-y: auto;
    position: absolute;
    left: 0;
    top: 0;
    display: inline-block !important;
    min-height: auto;
}

/*
 *  Front-end Admin Bar Icon
 */
#wpadminbar #wp-admin-bar-trp_edit_translation .ab-icon:before {
    content: '\f326';
    top: 3px;
}

@media screen and ( max-width: 782px ) {
    #wpadminbar #wp-admin-bar-trp_edit_translation > .ab-item {
        text-indent: 0;
    }

    #wpadminbar li#wp-admin-bar-trp_edit_translation {
        display: block;
    }
}

/*
 * Fix Language Switcher Shortcode in Elementor Popup
 */
.elementor-shortcode .trp-ls-shortcode-current-language,
.elementor-shortcode .trp-ls-shortcode-language {
    width: 300px !important;
}

/* Floating switcher */
.trp-floating-switcher {
    display: flex;
    flex-direction: column-reverse;
    position: fixed;
    z-index: 99999;
    overflow: hidden;
    padding: var(--switcher-padding, 10px);
    border: var(--border, none);
    border-radius: var(--border-radius, 8px);
    background: var(--bg, #fff);
    width: var(--switcher-width, auto);
    top: var(--top, unset);
    right: var(--right, unset);
    bottom: var(--bottom, unset);
    left: var(--left, unset);
    box-shadow: 0 10px 20px 0 #0000000D;
}

.trp-floating-switcher .trp-switcher-dropdown-list {
    flex-direction: column-reverse;
}

.trp-switcher-position-top.trp-floating-switcher {
    flex-direction: column;
}

.trp-floating-switcher.trp-switcher-position-top:not(.trp-ls-inline) .trp-language-switcher-inner,
.trp-floating-switcher.trp-switcher-position-top .trp-switcher-dropdown-list {
    flex-direction: column;
}

/* Inline variant */
div.trp-ls-inline .trp-language-switcher-inner {
    flex-direction: row;
}

.trp-ls-inline.trp-opposite-language .trp-language-item {
    width: 100%;
}

/* Powered by */
#trp-floater-powered-by {
    color: var(--text, #b3b3b3);
    font-size: 12px;
    text-align: center;
    padding: 0 5px;
}

#trp-floater-powered-by a {
    color: var(--text, #b3b3b3);
}

.trp-switcher-position-bottom #trp-floater-powered-by {
    border-top: 1px solid var(--text, #747474);
    padding-top: 5px;
    margin-top: 5px;
}

.trp-switcher-position-top #trp-floater-powered-by {
    border-bottom: 1px solid var(--text, #747474);
    padding-bottom: 5px;
    margin-bottom: 5px;
}

/* Shortcode switcher */
.trp-shortcode-switcher__wrapper {
    position: relative;
    border: none;
}

.trp-shortcode-switcher {
    position: static;
    display: inline-block;
    overflow: hidden;
    padding: 10px 0;
    border: var(--border, none);
    border-radius: var(--border-radius, 5px);
    background: var(--bg, #fff);
    width: auto;
    box-shadow: none;
}

.trp-shortcode-switcher.trp-open-on-click {
    cursor: pointer;
}

.trp-shortcode-overlay {
    position: absolute;
    left: 0;
    top: 0;
    z-index: 9999;
}

.trp-current-language-item__wrapper {
    display: flex;
    align-items: center;
    padding-right: 10px;
    justify-content: space-between;
}

/* Shared by both */
.trp-language-switcher-inner {
    display: flex;
}

.trp-floating-switcher .trp-language-switcher-inner {
    flex-direction: column-reverse;
}

.trp-shortcode-switcher .trp-language-switcher-inner {
    flex-direction: column;
}

.trp-switcher-dropdown-list {
    display: flex;
    overflow-y: hidden; /* closed state */
    transition: max-height 0.2s ease-in-out;
    max-height: 0;
    transition-duration: var(--transition-duration);
}

.trp-shortcode-switcher .trp-switcher-dropdown-list {
    flex-direction: column;
}

/* OPEN STATE — scroll the LIST (floating & shortcode) */
.trp-ls-dropdown.is-open .trp-switcher-dropdown-list,
.trp-ls-dropdown[aria-expanded="true"] .trp-switcher-dropdown-list,
.trp-shortcode-switcher.trp-open-on-hover.is-open .trp-switcher-dropdown-list,
.trp-shortcode-switcher[aria-expanded="true"] .trp-switcher-dropdown-list {
    overflow-y: auto;
    max-height: min(350px, 70vh);
    -webkit-overflow-scrolling: touch;
    scrollbar-width: thin;
    scrollbar-color: var(--text) transparent;
}

.trp-ls-dropdown.is-transitioning .trp-switcher-dropdown-list,
.trp-shortcode-switcher.is-transitioning .trp-switcher-dropdown-list {
    overflow-y: hidden !important;
}

.trp-shortcode-arrow {
    pointer-events: none;
}

.trp-shortcode-switcher.is-open .trp-shortcode-arrow {
    transform: rotate(180deg);
}

.trp-shortcode-overlay:focus { outline: none; }
.trp-shortcode-overlay:focus-visible {
    outline: 2px solid var(--text);
    outline-offset: 2px;
}

/* Links inside (optional) */
.trp-shortcode-overlay .trp-language-item:focus { outline: none; }
.trp-shortcode-overlay .trp-language-item:focus-visible {
    outline: 2px solid var(--text);
    outline-offset: 2px;
}

/* Items */
.trp-language-item {
    display: flex;
    align-items: center;
    gap: 8px;
    padding: 7px 16px;
    text-decoration: none;
    min-height: 19px;
    box-sizing: content-box;
}

.trp-language-item:hover {
    background: var(--bg-hover, #f3f3f3);
}

.trp-language-item:hover .trp-language-item-name {
    color: var(--text-hover, #000);
}

.trp-language-item__current {
    pointer-events: none;
    cursor: default;
}

.trp-language-item-name {
    display: inline-block;
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
    color: var(--text, #000);
    font-size: var(--font-size, 14px);
    line-height: 1.2;
    font-family: -apple-system,BlinkMacSystemFont,"Segoe UI",Roboto,Oxygen-Sans,Ubuntu,Cantarell,"Helvetica Neue",sans-serif;
    font-weight: 400;
}

.trp-flag-image {
    border-radius: var(--flag-radius, 0);
    aspect-ratio: var(--aspect-ratio, 4/3);
    width: var(--flag-size, 18px);
    display: inline-block;
}

.trp-menu-ls-label .trp-flag-image {
    margin: -2px 3px;
}

.trp-custom-flag {
    width: var(--flag-size, 18px);
    height: auto;
    aspect-ratio: var(--aspect-ratio, 4/3);
    border-radius: var(--flag-radius, 2px);
    object-fit: cover;
}

/* WebKit scrollbar styling on the ACTUAL scrollable element */
.trp-switcher-dropdown-list::-webkit-scrollbar { width: 6px; }
.trp-switcher-dropdown-list::-webkit-scrollbar-track { background: transparent; }
.trp-switcher-dropdown-list::-webkit-scrollbar-thumb {
    background-color: var(--text);
    border-radius: 4px;
}

.trp-switcher-dropdown-list::-webkit-scrollbar-thumb:hover {
    background-color: var(--text-hover);
}

/* Menu item */
.trp-flag-rounded {
    border-radius: 9999px;
    aspect-ratio: 1 / 1;
}

.trp-ls-name {
    padding-left: 5px;
}




/* Legacy Language Switcher shortcode css rules
 * Useful for displaying the Automatic Language Detection language switcher
*/


.trp_ald_ls_container img.trp-flag-image{
    padding-top: 0 !important;
}

.trp_ald_ls_container .trp-language-switcher{
    position: relative;
    display: inline-block;
    padding: 0;
    border: 0;

    box-sizing: border-box;
}


.trp_ald_ls_container .trp-language-switcher > div {
    box-sizing: border-box;

    padding-right: 20px;
    padding-bottom: 3px;
    padding-left: 13px;

    border: 1px solid #c1c1c1;
    border-radius: 3px;

    background-color: #fff;
}

.trp_ald_ls_container .trp-language-switcher > div > a {
    display: block;
    padding: 2px;
    border-radius: 3px;
    color: rgb(7, 105, 173);
}

.trp_ald_ls_container .trp-language-switcher > div > a:hover {
    background: #f1f1f1;
}
.trp_ald_ls_container .trp-language-switcher > div > a.trp-ls-shortcode-disabled-language {
    cursor: default;
}
.trp_ald_ls_container .trp-language-switcher > div > a.trp-ls-shortcode-disabled-language:hover {
    background: none;
}

.trp_ald_ls_container .trp-language-switcher > div > a > img{
    display: inline;
    margin: 0 3px;
    width: 18px;
    height: 12px;
    border-radius: 0;
}

.trp_ald_ls_container .trp-language-switcher .trp-ls-shortcode-current-language{
    display: inline-block;
}
.trp_ald_ls_container .trp-language-switcher:focus .trp-ls-shortcode-current-language,
.trp_ald_ls_container .trp-language-switcher:hover .trp-ls-shortcode-current-language{
    visibility: hidden;
}

.trp_ald_ls_container .trp-language-switcher .trp-ls-shortcode-language{
    display: inline-block;
    height: 1px;
    overflow: hidden;
    visibility: hidden;
    z-index: 1;

    max-height: 250px;
    overflow-y: auto;
    left: 0;
    top: 0;
    min-height: auto;
}

.trp_ald_ls_container .trp-language-switcher:focus .trp-ls-shortcode-language,
.trp_ald_ls_container .trp-language-switcher:hover .trp-ls-shortcode-language{
    visibility: visible;
    max-height: 250px;
    height: auto;
    overflow-y: auto;
    position: absolute;
    left: 0;
    top: 0;
    display: inline-block !important;
    min-height: auto;
}

#trp_ald_x_button{
    z-index: 0 !important;
}

