#trp-settings__wrap{
    padding: 32px;
}

#trp-settings-page{
    margin: 0;
}

#trp-settings-page h1{
    padding: 0;
}

#wpcontent{
    padding-left:0;
}

#trp-settings-page .notice, #trp-settings-page .error, #trp-settings-page .updated{
